import React, { Component } from "react";
import { useState, useEffect } from 'react';

import { Navbar, Brand, Container, Nav, Dropdown, Button, CardGroup, Card, Form, Row, Col } from "react-bootstrap";
import { useLocation } from "react-router-dom";
import logo_hyundai from '../img/MOBIS_LOGO.png';
import logo_hyundai1 from '../img/Icon ionic-md-arrow-dropdown.svg'

import './navbar.css';


function Header() {
  const [key, setKey] = useState('dashboard');
  const location = useLocation();

  const { pathname } = location;

  const splitLocation = pathname.split("/");

  return (
<>
    <Navbar bg="light1">
    <Navbar.Brand href="#home"><img src={logo_hyundai} />
    </Navbar.Brand>
    <Navbar.Toggle />
  <Navbar.Collapse className="justify-content-end">
    <Navbar.Text>
     <a href="#login" style={{marginRight:'20px',color:'#707070',fontFamily: "Hyundai Sans Head Office"}}>Shobith A K</a>
     <a href="#"></a>
     <img src={logo_hyundai1} />
    </Navbar.Text>
  </Navbar.Collapse>
  </Navbar>

  <Nav
  activeKey={location.pathname}
  onSelect={(selectedKey) => setKey(selectedKey) } style={{borderBottom :'1px solid #B2B2B2',     margin: '10px'}}
>
  <Nav.Item>
    <Nav.Link href="/" className={splitLocation[1] === "" ? "active" : ""}>Vertical Dashboard</Nav.Link>
  </Nav.Item>
  <Nav.Item>
    <Nav.Link href="/dashboard" className={splitLocation[1] === "dashboard" ? "active" : ""}>Horizontal Dashboard</Nav.Link>
  </Nav.Item>
 
  <Nav.Item className="justify-content-end" style={{    flex: '1'}}>
    <Nav.Link eventKey="disabled" style={{    textAlign: 'right',color:'#0A0A0A'}}>
      Dowload Report
    </Nav.Link>
  </Nav.Item>

</Nav>



 
</>
  
  );
}

export default Header;
